import { useEffect,useState } from "react"
import { fetchServer } from "../api_s/fetchServer"
import Item from "./Item"
function CommoditiesList(){
    const [comms,setComm]=useState(null)
    const [lastUpdate,setLastUpdate]=useState(null)
    useEffect(()=>{
        fetchServer('commodities').then(el=>{setComm(el.data);setLastUpdate(el.timestamp)}).catch(err=>console.error(err))
    },[])
    return(
        <tbody>
            {comms&& comms.map(comm =><Item item={comm} key={comm.symbol}/>)}
            {lastUpdate&&<div>{lastUpdate}</div>}
        </tbody>
    )
}
export default CommoditiesList
